import './App.scss';
import Navbar from './components/Navbar/Navbar';
import AuthPage from './pages/AuthPage/AuthPage';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="app">
     <Navbar />
     <Router>
      <Route path='/login' element={<AuthPage/>} />
     </Router>

    </div>
  );
}

export default App;
